INSERT INTO `gibdd_posts` (`id`, `post_name`, `post_disc`, `image`, `date`) VALUES
(1, 'ГИБДД не будет штрафовать за шины-липучки', 'В ГИБДД объяснили, когда автомобилистам грозит штраф за резину не по ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤсезонуㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ\r\nРоссийские водители могут ездить на шинах-липучках круглый год, не боясь получить за это штраф, заявил на брифинге глава ГИБДД Михаил Черников.ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ«Я еще раз повторюсь: «липучка» — так ее называют — не запрещена летом. Можно на «липучке» ездить как на всесезонной резине — она никак не повлияет на те или иные факторы», — подчеркнул он.\r\n\r\nПри этом Черников отметил, что езда на шинах-липучках летом приводит к быстрому износу резины. Поэтому наиболее эффективно использовать их зимой. Одновременно глава Госавтоинспекции напомнил, что использование шипованной зимней резины летом запрещено. Такое же ограничение касается летних шин зимой.\r\n\r\nВозможность штрафовать водителей за шипованную зимнюю резину летом и за поездки на летних покрышках зимой появилась у инспекторов ГИБДД с 1 сентября. До этого такой запрет действовал, но не подразумевал ответственность в виде штрафа в 500 рублей.\r\n\r\nДело в том, что с 1 сентября вступило в силу постановление правительства, меняющее перечень неисправностей автомобиля, при наличии которых его эксплуатация запрещается. В частности, появился штраф за шины не по сезону.\r\n\r\nКак объясняли Autonews.ru в ГИБДД, теперь используется единый для всей территории России подход по ограничению использования шин «не по сезону».\r\n\r\n«Так, например, летом (с июня по август) запрещено использовать ошипованные зимние шины, а зимой (с декабря по февраль) — летние. При этом запрет на использование зимой летних шин распространяется только на легковые автомобили и небольшие грузовики массой до 3,5 тонн», — поясняли в Госавтоинспекции.\r\n\r\nВодителя также накажут, если зимние шины, шины с шипами противоскольжения (в случае их применения) установлены не на все четыре колеса. Штраф за такое нарушение также составляет 500 руб. и оплатить его можно со скидкой 50%.', , '20th, Sep');

